import { FacebookLoginButton, GoogleLoginButton } from "react-social-login-buttons";
import './Media.css'
import { SocialIcon } from 'react-social-icons';



const Media = (props) => {

	return(
		<div>
			<div onClick = {this.onRouteChange} className = 'mygo'>
			  {'My Go'}
			</div>
			<div className = 'media'>
	             <SocialIcon className = 'google' network="google" bgColor="#fff" />
	             <SocialIcon className = 'facebook' network="facebook" bgColor="#fff" />

			</div>
		</div>



		);



}

export default Media;
